      index: 0,
      transition: "transform 0.2s ease",
    };
  },
  methods: {
    next() {
      // -1080 é a soma da largura dos itens excedentes.
      if (this.index === -1080) {
        this.index = 0;
      } else {
        this.index -= 360;
      }
    },
    prev() {
      if (this.index === 0) {
        this.index = -1080;
      } else {
        this.index += 360;
      }
    },
  }

};
